import React from "react";
import { List, Avatar } from "antd";

const data = [
  { title: "Rice", quantity: "40rs/KG" , imgSrc:"https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"},
  { title: "Wheat", quantity: "20rs/KG" , imgSrc:"https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"},
  { title: "Tomato", quantity: "30rs/KG" , imgSrc:"https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"}
];
class SellPage extends React.Component {
  render() {
    return (
      <>
        Sell Page
        <div style={{margin:'20%'}}>
          <List
            itemLayout="horizontal"
            bordered
            dataSource={data}
            size="medium"
            renderItem={item => (
              <List.Item>
                <List.Item.Meta
                  avatar={
                    <Avatar src={item.imgSrc} />
                  }
                  title={<a href="https://ant.design">{item.title}</a>}
                  description={item.quantity}
                />
              </List.Item>
            )}
          />
        </div>
        }
      </>
    );
  }
}

export default SellPage;
